/wiki\/%E2%80%99O_Sole_Mio\" class=\"mw-redirect\" title=\"\u2019O Sole Mio\">O Sole Mio!<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a><ul><li>\u041f\u043e\u0441\u043b\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0430\u0434\u0438\u043e\u0441\u0438\u0433\u043d\u0430\u043b \u0431\u0435\u0434\u0441\u0442\u0432\u0438\u044f, \u0432\u044b\u0437\u044b\u0432\u0430\u044f \u043d\u0430 \u043f\u043e\u043c\u043e\u0449\u044c \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u043e\u043c\u0443 \u0441\u0443\u0434\u043d\u0443, \u0441\u0435\u0432\u0448\u0435\u043c\u0443 \u043d\u0430 \u043c\u0435\u043b\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BB%D1%8C_%D0%93%D1%83%D0%B4%D0%B2%D0%B8%D0%BD%D0%B0\" title=\"\u041c\u0435\u043b\u044c \u0413\u0443\u0434\u0432\u0438\u043d\u0430\">\u041f\u0435\u0441\u043a\u0430\u0445 \u0413\u0443\u0434\u0432\u0438\u043d\u0430<\/a>, \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D0%BD%D1%82\" title=\"\u041a\u0435\u043d\u0442\">\u041a\u0435\u043d\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a>.<\/li><li>\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0430\u0441\u0442\u0440\u043e\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BA%D0%B5%D1%80%D0%B8%D0%BD%D0%B3,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC_%D0%93%D0%B5%D0%BD%D1%80%D0%B8\" title=\"\u041f\u0438\u043a\u0435\u0440\u0438\u043d\u0433, \u0423\u0438\u043b\u044c\u044f\u043c \u0413\u0435\u043d\u0440\u0438\">\u0423\u0438\u043b\u044c\u044f\u043c \u041f\u0438\u043a\u0435\u0440\u0438\u043d\u0433<\/a> \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D0%B1%D0%B0_(%D1%81%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD%D0%B0)\" title=\"\u0424\u0435\u0431\u0430 (\u0441\u043f\u0443\u0442\u043d\u0438\u043a \u0421\u0430\u0442\u0443\u0440\u043d\u0430)\">\u0424\u0435\u0431\u0443<\/a>, \u0441\u043f\u0443\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%82%D1%83%D1%80%D0%BD_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u0421\u0430\u0442\u0443\u0440\u043d (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u0421\u0430\u0442\u0443\u0440\u043d\u0430<\/a>.<\/li><\/ul><\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0412 \u041a\u0438\u0435\u0432\u0435 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B0%D0%B4%D0%B0_%D0%A3%D0%9D%D0%A0\" class=\"mw-redirect\" title=\"\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0420\u0430\u0434\u0430 \u0423\u041d\u0420\">\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0420\u0430\u0434\u0430<\/a> (\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u043e\u0432\u0435\u0442) \u043f\u043e\u0434 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c \u0438\u0441\u0442\u043e\u0440\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D1%83%D1%88%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0440\u0443\u0448\u0435\u0432\u0441\u043a\u0438\u0439, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041c.&#160;\u0421.&#160;\u0413\u0440\u0443\u0448\u0435\u0432\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0423\u0441\u0430\u0434\u044c\u0431\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0410.&#160;\u0421.&#160;\u041f\u0443\u0448\u043a\u0438\u043d\u0430<\/a> \u0432 \u0441\u0435\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_(%D0%BC%D1%83%D0%B7%D0%B5%D0%B9-%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA)\" title=\"\u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0441\u043a\u043e\u0435 (\u043c\u0443\u0437\u0435\u0439-\u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a)\">\u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0441\u043a\u043e\u043c<\/a>, \u0435\u0433\u043e \u043c\u043e\u0433\u0438\u043b\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C_(%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B5_%D0%93%D0%BE%D1%80%D1%8B)\" class=\"mw-redirect\" title=\"\u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0441\u043a\u0438\u0439 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c (\u041f\u0443\u0448\u043a\u0438\u043d\u0441\u043a\u0438\u0435 \u0413\u043e\u0440\u044b)\">\u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0441\u043a\u043e\u043c \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u0435<\/a> \u0438 \u0431\u043b\u0438\u0437\u043b\u0435\u0436\u0430\u0449\u0438\u0435 \u043c\u0435\u0441\u0442\u0430&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5\" title=\"\u0422\u0440\u0438\u0433\u043e\u0440\u0441\u043a\u043e\u0435\">\u0422\u0440\u0438\u0433\u043e\u0440\u0441\u043a\u043e\u0435<\/a>, \u0413\u043e\u0440\u043e\u0434\u0438\u0449\u0435 \u0438 \u0434\u0435\u0440\u0435\u0432\u043d\u044e \u0412\u043e\u0440\u043e\u043d\u0438\u0447 \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_(%D0%BC%D1%83%D0%B7%D0%B5%D0%B9-%D0%B7%D0%B0%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA)\" title=\"\u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0441\u043a\u043e\u0435 (\u043c\u0443\u0437\u0435\u0439-\u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a)\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u043d\u0430 \u0437\u0430\u0432\u043e\u0434\u0435 \u00ab\u0421\u0432\u0435\u0442\u043b\u0430\u043d\u0430\u00bb \u043d\u0430\u0447\u0430\u0442\u043e \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u043c\u0438\u043d\u0438\u0430\u0442\u044e\u0440\u043d\u044b\u0445 \u043b\u0430\u043c\u043f\u043e\u0447\u0435\u043a \u0434\u043b\u044f \u043a\u0430\u0440\u043c\u0430\u043d\u043d\u044b\u0445 \u0444\u043e\u043d\u0430\u0440\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u041f\u043e\u0441\u043b\u0435 \u0441\u0442\u0443\u0434\u0435\u043d\u0447\u0435\u0441\u043a\u0438\u0445 \u0432\u043e\u043b\u043d\u0435\u043d\u0438\u0439 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> \u0437\u0430\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B4%D1%80%D0%B8%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" class=\"mw-disambig\" title=\"\u041c\u0430\u0434\u0440\u0438\u0434\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u041c\u0430\u0434\u0440\u0438\u0434\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f<\/a> \u0437\u0430\u043a\u0430\u0437\u0430\u043b\u0430 875 \u0442\u044b\u0441\u044f\u0447 \u0431\u0443\u0442\u044b\u043b\u043e\u043a \u0441\u043f\u0438\u0440\u0442\u043d\u043e\u0433\u043e \u0432 \u0437\u043d\u0430\u043a \u0441\u043c\u044f\u0433\u0447\u0435\u043d\u0438\u044f \u0441\u0443\u0445\u043e\u0433\u043e \u0437\u0430\u043a\u043e\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D0%BE%D0%B5%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7\" title=\"\u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439 \u0441\u043e\u044e\u0437\">\u0411\u0440\u044e\u0441\u0441\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u043f\u0430\u043a\u0442<\/a> \u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0438 \u0432\u043e\u0435\u043d\u043d\u043e-\u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0433\u043e \u0441\u043e\u044e\u0437\u0430 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\">\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e\u0431 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0438 98-\u0433\u043e \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D0%B9\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u0439\">\u043a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1951_%D0%B3%D0%BE%D0%B4\" title=\"1951 \u0433\u043e\u0434\">1951<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BE%D0%B2%D1%81%D1%82%D0%B0%D0%BD%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u043f\u043e\u0432\u0441\u0442\u0430\u043d\u0447\u0435\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0430\u044f \u041f\u043e\u0432\u0441\u0442\u0430\u043d\u0447\u0435\u0441\u043a\u0430\u044f \u0410\u0440\u043c\u0438\u044f<\/a> (\u0423\u041f\u0410) \u043f\u0440\u0438\u0437\u0432\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043f\u043e\u043c\u043e\u0447\u044c \u0435\u0439 \u0432 \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%82%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0\" title=\"\u0410\u0442\u043e\u043c\u043d\u0430\u044f \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430\">\u0441\u0443\u0431\u043c\u0430\u0440\u0438\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/USS_Skate_(SSN-578)\" title=\"USS Skate (SSN-578)\">SSN-578 \u00abSkate\u00bb<\/a>, \u043f\u0440\u043e\u0431\u0438\u0432 \u0440\u0443\u0431\u043a\u043e\u0439 \u0441\u043b\u043e\u0439 \u043b\u044c\u0434\u0430, \u0432\u0441\u043f\u043b\u044b\u043b\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D1%8E%D1%81\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u043c \u043f\u043e\u043b\u044e\u0441\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u0432 \u043d\u043e\u0447\u044c \u043d\u0430 17 \u043c\u0430\u0440\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BB%D0%B0%D0%B9-%D0%BB%D0%B0%D0%BC%D0%B0_XIV\" title=\"\u0414\u0430\u043b\u0430\u0439-\u043b\u0430\u043c\u0430 XIV\">\u0414\u0430\u043b\u0430\u0439-\u043b\u0430\u043c\u0430 XIV<\/a> \u0438 \u0435\u0433\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u043a\u0438 \u0431\u0435\u0436\u0430\u043b\u0438 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D0%B1%D0%B5%D1%82\" title=\"\u0422\u0438\u0431\u0435\u0442\">\u0422\u0438\u0431\u0435\u0442\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0438\u043d\u0434\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%85%D0%B0%D1%80%D0%B0%D0%BC%D1%81%D0%B0%D0%BB%D0%B0\" class=\"mw-redirect\" title=\"\u0414\u0445\u0430\u0440\u0430\u043c\u0441\u0430\u043b\u0430\">\u0414\u0445\u0430\u0440\u0430\u043c\u0441\u0430\u043b\u0430<\/a>. \u0422\u0430\u043c \u0431\u044b\u043b\u043e \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043e \u0442\u0438\u0431\u0435\u0442\u0441\u043a\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\">\u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e<\/a> \u0432 \u0438\u0437\u0433\u043d\u0430\u043d\u0438\u0438, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0435 \u043f\u043e \u0441\u0435\u0439 \u0434\u0435\u043d\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u0432 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u0440\u0430\u0437\u043d\u043e\u0446\u0432\u0435\u0442\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D0%BC%D0%B0%D1%81%D1%82%D0%B5%D1%80\" title=\"\u0424\u043b\u043e\u043c\u0430\u0441\u0442\u0435\u0440\">\u0444\u043b\u043e\u043c\u0430\u0441\u0442\u0435\u0440\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B8%D1%80,_%D0%93%D0%BE%D0%BB%D0%B4%D0%B0\" title=\"\u041c\u0435\u0438\u0440, \u0413\u043e\u043b\u0434\u0430\">\u0413\u043e\u043b\u0434\u0430 \u041c\u0435\u0438\u0440<\/a> \u0431\u044b\u043b\u0430 \u0438\u0437\u0431\u0440\u0430\u043d\u0430 \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0434\">1980<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043b \u0437\u0430 \u0431\u043e\u0439\u043a\u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8