%D0%B2%D0%BA%D0%B0_(1985)\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 (1985)\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0438<\/a> \u042d\u043a\u0441\u043f\u043e-85 \u0432 \u0433\u043e\u0440\u043e\u0434\u0435 \u0426\u0443\u043a\u0443\u0431\u0430, \u0418\u0431\u0430\u0440\u0430\u043a\u0438, \u042f\u043f\u043e\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 \u041f\u0440\u043e\u0448\u0451\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%81%D0%BE%D1%8E%D0%B7%D0%BD%D1%8B%D0%B9_%D1%80%D0%B5%D1%84%D0%B5%D1%80%D0%B5%D0%BD%D0%B4%D1%83%D0%BC_%D0%BE_%D1%81%D0%BE%D1%85%D1%80%D0%B0%D0%BD%D0%B5%D0%BD%D0%B8%D0%B8_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u044b\u0439 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c \u043e \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0438 \u0421\u0421\u0421\u0420\">\u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u044b\u0439 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c<\/a>, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0442\u0440\u0438 \u0447\u0435\u0442\u0432\u0435\u0440\u0442\u0438 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u0432\u0448\u0438\u0445 \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u043b\u0438\u0441\u044c \u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D1%81%D0%BF%D0%B0%D0%B4_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0420\u0430\u0441\u043f\u0430\u0434 \u0421\u0421\u0421\u0420\">\u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u0421\u0421\u0421\u0420<\/a>. \u041e\u0434\u043d\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e \u0432 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u043c \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\u0435 70&#160;% \u043f\u0440\u043e\u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043b\u0438 \u0437\u0430 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u043f\u043e\u0441\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0420\u0421\u0424\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u041d\u0430 \u0440\u0435\u0444\u0435\u0440\u0435\u043d\u0434\u0443\u043c\u0435 \u0431\u0435\u043b\u043e\u0435 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%BE-%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u043e-\u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u042e\u0410\u0420<\/a> \u043f\u0440\u0438\u043d\u044f\u043b\u043e \u043d\u043e\u0432\u0443\u044e \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e, \u0443\u0440\u0430\u0432\u043d\u0438\u0432\u0430\u044e\u0449\u0443\u044e \u0432 \u043f\u0440\u0430\u0432\u0430\u0445 \u0431\u0435\u043b\u044b\u0445 \u0438 \u0447\u0451\u0440\u043d\u044b\u0445 \u0433\u0440\u0430\u0436\u0434\u0430\u043d \u0441\u0442\u0440\u0430\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D0%B0%D0%BA%D1%82_%D0%B2_%D0%91%D1%83%D1%8D%D0%BD%D0%BE%D1%81-%D0%90%D0%B9%D1%80%D0%B5%D1%81%D0%B5_(1992)\" title=\"\u0422\u0435\u0440\u0430\u043a\u0442 \u0432 \u0411\u0443\u044d\u043d\u043e\u0441-\u0410\u0439\u0440\u0435\u0441\u0435 (1992)\">\u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u0411\u0443\u044d\u043d\u043e\u0441-\u0410\u0439\u0440\u0435\u0441\u0435<\/a>. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0432\u0437\u0440\u044b\u0432\u0430 \u043f\u043e\u0433\u0438\u0431\u043b\u043e 29 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, 242 \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u0440\u0430\u043d\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u043e \u044e\u0441\u0442\u0438\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a> \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b\u043e \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0435 \u043a\u0430\u0437\u0430\u0447\u0435\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 \u0412 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e\u043c \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD\" title=\"\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\">\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0430<\/a> \u0431\u043b\u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%B0%D0%BA%D0%B5%D1%80%D1%82\" title=\"\u0421\u0442\u0435\u043f\u0430\u043d\u0430\u043a\u0435\u0440\u0442\">\u0425\u0430\u043d\u043a\u0435\u043d\u0434\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8\" title=\"\u0412\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0410\u0440\u043c\u0435\u043d\u0438\u0438\">\u0430\u0440\u043c\u044f\u043d\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u043c\u0438 \u0441\u0438\u043b\u0430\u043c\u0438<\/a> \u0431\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D1%81_%D0%B8%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%BC_C-130_(1994)\" class=\"mw-redirect\" title=\"\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0441 \u0438\u0440\u0430\u043d\u0441\u043a\u0438\u043c C-130 (1994)\">\u0441\u0431\u0438\u0442<\/a> \u0432\u043e\u0435\u043d\u043d\u043e-\u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u043d\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Lockheed_C-130_Hercules\" title=\"Lockheed C-130 Hercules\">C-130 Hercules<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D1%8B%D0%B5_%D1%81%D0%B8%D0%BB%D1%8B_%D0%98%D1%81%D0%BB%D0%B0%D0%BC%D1%81%D0%BA%D0%BE%D0%B9_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8_%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0438\u043b\u044b \u0418\u0441\u043b\u0430\u043c\u0441\u043a\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0418\u0440\u0430\u043d\">\u0438\u0440\u0430\u043d\u0441\u043a\u0438\u0445 \u0412\u0412\u0421<\/a>, \u043f\u0435\u0440\u0435\u0432\u043e\u0437\u0438\u0432\u0448\u0438\u0439 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%B3%D0%B5%D1%80%D0%B0%D0%BD\" title=\"\u0422\u0435\u0433\u0435\u0440\u0430\u043d\">\u0422\u0435\u0433\u0435\u0440\u0430\u043d<\/a> \u0441\u0435\u043c\u044c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0438\u0440\u0430\u043d\u0441\u043a\u0438\u0445<\/a> \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u043e\u0432. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 19 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u043e\u0432 (\u0432\u0441\u0451&#160;\u2014 \u0436\u0435\u043d\u0449\u0438\u043d\u044b \u0438 \u0434\u0435\u0442\u0438) \u0438 13 \u0447\u043b\u0435\u043d\u043e\u0432 \u044d\u043a\u0438\u043f\u0430\u0436\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1995_%D0%B3%D0%BE%D0%B4\" title=\"1995 \u0433\u043e\u0434\">1995<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8F%D1%82%D0%B5%D0%B6_%D0%B0%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%9E%D0%9F%D0%9E%D0%9D\" title=\"\u041c\u044f\u0442\u0435\u0436 \u0430\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u041e\u041f\u041e\u041d\">\u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u044b\u0435 \u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u044f<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%9F%D0%9E%D0%9D_(%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD)\" title=\"\u041e\u041f\u041e\u041d (\u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d)\">\u041e\u041f\u041e\u041d<\/a> \u0438 \u0430\u0440\u043c\u0435